@StructuralBiol7 Yes that’s very interesting, thanks. 
There’s lots of examples also of the start of vaccination coinciding with a spike in deaths. Gibraltar started (mass) vaccination on 10.01.2020 on 10 deaths. 
By the 20th, this had increased to 53 , and to 70 seven days later. https://t.co/TkPUjM79E7
